import GetRecipes from './GetRecipes';

GetRecipes();

const Home = ({navigation, route}) => {
  console.log("USERID: ", route.params.uid);
  const uid = route.params.uid;
    return (
      <Text>Hello, {uid}</Text>
    );
};

export {Home};
